--CREATE DATABASE ShoppingOnline
Go

Use ShoppingOnline
Go

create table Category (
	id INT primary key,
	name VARCHAR(50)
);




create table Product (
	id INT,
	name VARCHAR(max),
	quantity INT,
	price DECIMAL(3,1),
	description VARCHAR(max),
	imageUrl VARCHAR(max),
	created_date DATE,
	category_id INT foreign key references Category(id),
	primary key (id)
);



